import React from 'react';
import { MenuList } from '../../holpers/MenuList';


function Course() {
  return (
    <div className='Menu'>
      <h1>Data Science</h1>
      <div className='menuList'>
        {MenuList.map((menuItem, key)=>{
          return <div>{menuItem.name}</div>
        })}
      </div>
    </div>
  )
}

export default Course
